import React from 'react';

function Food({fav}){
  //console.log(props.fav);
  return <h1>i love {fav}</h1>
}

function App() {
  return (
    <div className="App">
      <h1>hi!</h1>      
      <Food fav = "kimchi"/>

    </div>
  );
}

export default App;
